import React, { Component } from 'react'
import { Button } from 'antd'
import './index.css'

export default class index extends Component {
  render() {
    return (
      <div>
          <div className='title'>
              <span>登录</span>
              <span>账号注册</span>
          </div>
          <Button type="primary">Primary Button</Button>
      </div>
    )
  }
}
